START TRANSACTION;

DROP TABLE IF EXISTS `journal_686`;
CREATE TABLE IF NOT EXISTS `journal_686` (
  `timestamp` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `actor` varchar(31) NOT NULL,
  `action` varchar(8190) NOT NULL,
  `id` bigint(20) unsigned NOT NULL auto_increment,
  PRIMARY KEY  (`id`),
  KEY `actor` (`actor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `journal_852`;
CREATE TABLE IF NOT EXISTS `journal_852` (
  `timestamp` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `actor` varchar(31) NOT NULL,
  `action` varchar(8190) NOT NULL,
  `id` bigint(20) unsigned NOT NULL auto_increment,
  PRIMARY KEY  (`id`),
  KEY `actor` (`actor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `journal_new`;
CREATE TABLE IF NOT EXISTS `journal_new` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `timestamp` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `actor` varchar(31) NOT NULL,
  `action` varchar(8190) NOT NULL,
  PRIMARY KEY  (`id`),
  KEY `actor` (`actor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



select `timestamp`,`actor`,`action`
from journal_686;

select `timestamp`,`actor`,`action`
from journal_852;

select `timestamp`,`actor`,`action`
from journal;

drop table journal_686,journal_852,journal;

ALTER TABLE `journal_new` RENAME TO `journal`;

COMMIT